import BarChart from "./components/visual1"

export default class Visualizations extends Component {

   render() {
      return (
        <div>
        <Container>
        <BarChart
            data={{
               AL: 123,
               AK: 34,
               AZ: 23,
               AR: 943,
               CA: 3,
               CO: 23,
               CT: 54,
               DE: 19,
               FL: 20,
               GA: 4,
