            x="State (State Abbreviation)"
            y="Organizations (Number of Organizations)"
         />
      </Container>

      <Container>
      <BarChart
          data={{
             AL: 123,
             AK: 34,
             AZ: 23,
             AR: 943,
             CA: 3,
             CO: 23,
             CT: 54,
             DE: 19,
             FL: 20,
             GA: 4,
          }}
          x="State (State Abbreviation)"
          y="Organizations (Number of Organizations)"
       />
    </Container>
      </div>

      );
  }
}
